const AddTransaction = () => {
    return (
        <div>
            <h3>Add New Transaction</h3>
            <form action="">
                <div>
                    <label htmlFor="Text">Text</label>
                    <input type="text" />
                </div>
                <div>
                    <label htmlFor="">Amount</label>
                    <input type="text" />
                </div>
                <button>Add Transaction</button>
            </form>
        </div>
    );
};

export default AddTransaction;
